var getHtml = function (charmap) {
    var gridHtml, x, y;
    var size = Object.keys(charmap).length
    var width = Math.min(size, 25);
    var height = Math.ceil(size / width);
    gridHtml = '<table id="signWritringTable" role="presentation" cellspacing="0" class="mce-charmap"><tbody>';
    var contadorRef = parseInt(width);
    var counter = contadorRef;

    for(indice in charmap){
        if(counter==contadorRef){
            gridHtml += '<tr>';
        }
        chrText = "<img style='height: 10px; width:10px' src='http://www.signbank.org/signpuddle2.0/glyphogram.php?text="+charmap[indice]+"' alt='"+indice+"' />";
        gridHtml += '<td title="' + indice + '">' + '<div tabindex="-1" title="' + indice + '" role="button" data-chr="' + charmap[indice] + '">' + chrText + '</div>' + '</td>';
        counter= counter-1;
        if(counter<0){
            counter = contadorRef;
            gridHtml += '</tr>';
        }
    }
    gridHtml += '</tbody></table>';
    return gridHtml;
  };
